import React from 'react';
import { Link } from 'react-router-dom';
import './Nav.css'
const Nav = () => {
  return (
    <nav id="nav">
      <ul>
        <li>
          <Link to="/">Home</Link>
        </li>
        <li>
          <Link to="/portfolio">Portfolio</Link>
        </li>
        <li>
          <Link to="/contact">Contact</Link>
        </li>
      </ul>
    </nav>
  );
};

export default Nav;
